import { image_to_gltf } from "./pix2gltfr/Cargo.toml";

console.log(image_to_gltf);

const fileInput = document.querySelector("#file-input") as HTMLInputElement;
const inCanvases = document.querySelector("#in-canvases") as HTMLElement;
const outCanvases = document.querySelector("#out-canvases") as HTMLElement;
const imageContainer = document.querySelector("#image-container") as HTMLElement;

const fileEventToFileList = (event: Event): FileList => ((event.target as HTMLInputElement).files)

const dataUrlToImage = (dataUrl: string, index: number): Promise<HTMLImageElement> => {
  return new Promise((resolve, reject) => {
    if (imageContainer.contains(document.querySelector(`image-${index}`))) {
      const img = document.querySelector(`image-${index}`) as HTMLImageElement;
      img.id = `image-${index}`;
      img.src = dataUrl;
      img.onload = () => resolve(img);
      img.onerror = reject;
    } else {
      let img = document.createElement("img");
      img.id = `image-${index}`;
      img.src = dataUrl;
      img = imageContainer.appendChild(img);
      img.onload = () => resolve(img);
      img.onerror = reject;
    }
  });
}

const imageToCanvas = (image: HTMLImageElement, index: number): HTMLCanvasElement => {
  const canvas = document.querySelector(`canvas-${index}`) as HTMLCanvasElement || document.createElement("canvas");
  inCanvases.appendChild(canvas);
  canvas.id = `canvas-${index}`;
  const ctx = canvas.getContext("2d");
  canvas.width = image.naturalWidth;
  canvas.height = image.naturalHeight;
  ctx.drawImage(image, 0, 0);
  return canvas;
}



const canvasToImageData = (canvas: HTMLCanvasElement): ImageData => canvas.getContext("2d").getImageData(0, 0, canvas.width, canvas.height);


const objURLset = new Set<string>();
let i = 0;
addEventListener("change", async (event) => {
  const files = fileEventToFileList(event);
  if (files.length > 0) {
    // cleanup old image objects
    for (let url of objURLset.values()) {
      URL.revokeObjectURL(url);
      objURLset.delete(url);
    }

    // create image objects
    const urls = Array.from(files).map(URL.createObjectURL);
    urls.forEach(u => objURLset.add(u));

    // await image dom load
    const images = await Promise.all(urls.map(dataUrlToImage));
    const canvases = images.map(imageToCanvas);
    const imageDatas = canvases.map(canvasToImageData);
    const gltf = imageDatas.map(image_to_gltf);

    for (const model of gltf) {
      const gltf_url = URL.createObjectURL(new Blob([model], { type: "application/octet-stream" }));
      const dlLink = document.createElement("a");
      dlLink.innerText = `Download gltf ${i++}`;
      dlLink.href = gltf_url;
      dlLink.download = `pic_${i}.gltf`;
      dlLink.click();
      URL.revokeObjectURL(gltf_url);
    }
  }
})
